import 'font-awesome/css/font-awesome.min.css'

const App = () => {

  return (
    <Fragment>
      <NavBar title = "test navBAr "/>
      <div className="container-fluid">
        <div className="row">
          <Contacts />  
        </div>

      </div>
    </Fragment>
  );
}

export default App;
